-- LDS Layer Properties Initialiser - SQL
DROP TABLE IF EXISTS LDS_CONFIG;
CREATE TABLE LDS_CONFIG (ID VARCHAR(8), PKEY VARCHAR(32) DEFAULT 'ID', NAME VARCHAR(128), CATEGORY VARCHAR(256), LASTMODIFIED TIMESTAMP DEFAULT NULL, GEOCOLUMN VARCHAR(32) DEFAULT 'SHAPE',EPSG INT DEFAULT NULL,DISCARD VARCHAR(256) DEFAULT NULL,CQL VARCHAR(256) DEFAULT NULL);
